      out.write("\t\t<span class=\"c0 c8\">&nbsp;</span>\n");
      out.write("\t</p>\n");
      out.write("\t<p class=\"c4 c13 c58\">\n");
      out.write("\t\t<span>Aos </span><span class=\"c0\">02 (dois)</span><span>&nbsp;dias\n");
      out.write("\t\t\tdo m&ecirc;s de </span><span class=\"c0\">janeiro</span><span>&nbsp;do\n");
      out.write("\t\t\tano de </span><span class=\"c0\">2013 (dois mil e treze)</span><span>,\n");
      out.write("\t\t\tnesta Capital e no </span><span class=\"c0\">Instituto de\n");
      out.write("\t\t\tCriminal&iacute;stica Leonardo Rodrigues</span><span>, da </span><span\n");
      out.write("\t\t\tclass=\"c0\">Superintend&ecirc;ncia de Pol&iacute;cia\n");
      out.write("\t\t\tT&eacute;cnico-Cient&iacute;fica da Secretaria da Seguran&ccedil;a\n");
      out.write("\t\t\tP&uacute;blica e Justi&ccedil;a</span><span>, pelo Gerente do\n");
      out.write("\t\t\tInstituto, </span><span class=\"c0\">Dr. Wagner Torres Fernandes</span><span>,\n");
      out.write("\t\t\tfoi designado o Perito Criminal &lt;equipe_perito&gt;</span><span class=\"c0\">,\n");
      out.write("\t\t</span><span>para proceder ao </span><span class=\"c0\">Exame Pericial\n");
      out.write("\t\t\tde Local de Morte Violenta</span><span>, a fim de ser atendida\n");
      out.write("\t\t\trequisi&ccedil;&atilde;o do(a) &lt;comunicante_oc&gt;.</span>\n");
