      out.write("\t</p>\n");
      out.write("\t<p class=\"c4 c14\">\n");
      out.write("\t\t<span class=\"c0 c8\">1 &ndash; HIST&Oacute;RICO</span>\n");
      out.write("\t</p>\n");
      out.write("\t<p class=\"c4 c14\">\n");
      out.write("\t\t<span class=\"c0 c8\">&nbsp;</span>\n");
      out.write("\t</p>\n");
      out.write("\t<p class=\"c4 c9\">\n");
      out.write("\t\t<span>Comunicado o fato via telef&ocirc;nica pelo(a)\n");
      out.write("\t\t\t&lt;comunicante_oc&gt;, por volta das &lt;hora_comunic_oc&gt; do dia\n");
      out.write("\t\t\t&lt;data_comunic_oc&gt;, o Perito Criminal compareceu ao local abaixo\n");
      out.write("\t\t\tespecificado, onde procedeu ao Levantamento Pericial requisitado de\n");
      out.write("\t\t\tlocal de &lt;tipo_pericia&gt;. Chegando ao local, constatou-se que se\n");
      out.write("\t\t\ttratava de uma ocorr&ecirc;ncia de &lt;tipo_oc&gt;, perpetrado\n");
      out.write("\t\t\tmediante &lt;armas_usadas&gt;. O fato ocorreu na &lt;rua&gt;,\n");
      out.write("\t\t\t&lt;complemento&gt;, &lt;bairro&gt;, &lt;cidade&gt;, &lt;estado&gt;,\n");
      out.write("\t\t\t&lt;observacao&gt;.</span>\n");
      out.write("\t</p>\n");
      out.write("\t<p class=\"c4 c9\">\n");
      out.write("\t\t<span>No momento da chegada da Pol&iacute;cia Cient&iacute;fica\n");
      out.write("\t\t\tao local, a(o) &lt;instituicao&gt;, representada pelo\n");
      out.write("\t\t\t&lt;responsaveis&gt;, ambos na viatura &lt;viatura&gt; do(a)\n");
      out.write("\t\t\t&lt;batalhao&gt;, realizavam o isolamento do local e\n");
      out.write("\t\t\tpreserva&ccedil;&atilde;o dos vest&iacute;gios. Segundo\n");
      out.write("\t\t\tinforma&ccedil;&otilde;es obtidas no local, uma equipe de socorro\n");
      out.write("\t\t\tdo(s) &lt;instituicao&gt; (&lt;viatura&gt;), representada pelo\n");
      out.write("\t\t\tm&eacute;dico &lt;medico_crm&gt;, esteve no local e constataram o\n");
      out.write("\t\t\t&oacute;bito da v&iacute;tima por volta de &lt;horario_obito_soc&gt;\n");
      out.write("\t\t\tdo dia &lt;data_obito_soc&gt;.</span>\n");
      out.write("\t</p>\n");
      out.write("\t<p class=\"c4 c9\">\n");
      out.write("\t\t<span>No local constatamos a presen&ccedil;a da\n");
      out.write("\t\t\t&lt;tipo_vitima&gt; (&lt;nome_vitima&gt;) do sexo\n");
