      out.write("\t\t\t&lt;tipo_lesao&gt;.</span>\n");
      out.write("\t</p>\n");
      out.write("\t<p class=\"c4 c9\">\n");
      out.write("\t\t<span>Segundo consta, o fato ocorreu por volta de\n");
      out.write("\t\t\t&lt;hora_fato&gt; do dia &lt;data_fato&gt;, &nbsp;HISTORICO&hellip;</span><span\n");
