      out.write("\t</p>\n");
      out.write("\t<p class=\"c4 c9\">\n");
      out.write("\t\t<span>No local tamb&eacute;m se fazia presente uma equipe do(a)\n");
      out.write("\t\t\t&lt;delegacia_local&gt;, dando in&iacute;cio &agrave;s suas\n");
      out.write("\t\t\tinvestiga&ccedil;&otilde;es in loco. O boletim de ocorr&ecirc;ncia\n");
      out.write("\t\t\tfoi registrado com o n&uacute;mero &lt;bo_delegacia&gt;.</span>\n");
      out.write("\t</p>\n");
      out.write("\t<p class=\"c4 c57\">\n");
      out.write("\t\t<span>Os trabalhos Periciais contaram com a\n");
      out.write("\t\t\tparticipa&ccedil;&atilde;o do Motorista &lt;equipe_motorista&gt;\n");
      out.write("\t\t\t(lotado no IC/SPTC) e do Fot&oacute;grafo Criminal&iacute;stico\n");
      out.write("\t\t\t&lt;equipe_fotografo&gt;. A Per&iacute;cia teve in&iacute;cio por\n");
      out.write("\t\t\tvolta de &lt;hora_inic_pericia&gt; do dia &lt;data_inic_pericia&gt;,\n");
